import React from "react";
import { EventData } from "../type";
import EventMarker from "./EventMarker";

interface Props {
  events: EventData[];
  onSelectEvent: (event: EventData) => void;
}

const Timeline: React.FC<Props> = ({ events, onSelectEvent }) => {
  return (
    <div className="timeline">
      {events.map((event) => (
        <EventMarker key={event.year} event={event} onClick={() => onSelectEvent(event)} />
      ))}
    </div>
  );
};

export default Timeline;
